import {createRouter, createWebHistory} from "vue-router";
import ordinalsOrder from "@/components/ordinals-order";
import ordinalsOrderRegistration from "@/components/order/ordinals-order-registration";
import ordinalsOrderRegistrationType2 from "@/components/order/ordinals-order-registration-type2";
import ordinalsOrderPayment from "@/components/order/ordinals-order-payment";
import ordinalsOrderPaymentType2 from "@/components/order/ordinals-order-payment-type2";
import ordinalsOrderComplete from "@/components/order/ordinals-order-complete";
import ordinalsOrderCompleteType2 from "@/components/order/ordinals-order-complete-type2";
// import ordinalsFaq from "@/components/ordinals-faq";
import ordinalsCheck from "@/components/ordinals-check";
import ordinals404 from "@/components/ordinals-404";

export default createRouter({
    history: createWebHistory(),
    routes: [
        {
            path: '/',
            name: 'order',
            component: ordinalsOrder,
            children: [
                {
                    path: '',
                    name: 'registration',
                    component: ordinalsOrderRegistration,
                    meta: {
                        title: "Ordinals"
                    },
                },

                {
                    path: 'buy-ordinals',
                    name: 'buy-ordinals',
                    component: ordinalsOrderRegistrationType2,
                    meta: {
                        title: "Ordinals"
                    },
                },

                {
                    path: 'payment',
                    name: 'payment',
                    component: ordinalsOrderPayment,
                    meta: {
                        title: "Ordinals"
                    },
                },

                {
                    path: 'purchase',
                    name: 'purchase',
                    component: ordinalsOrderPaymentType2,
                    meta: {
                        title: "Ordinals"
                    },
                },

                {
                    path: 'complete',
                    name: 'complete',
                    component: ordinalsOrderComplete,
                    meta: {
                        title: "Ordinals"
                    },
                },

                {
                    path: 'created',
                    name: 'created',
                    component: ordinalsOrderCompleteType2,
                    meta: {
                        title: "Ordinals"
                    },
                },
            ],
        },

        // {
        //     path: '/faq',
        //     name: "faq",
        //     component: ordinalsFaq,
        //     meta: {
        //         title: "Ordinals"
        //     },
        // },

        {
            path: '/check',
            name: "check",
            component: ordinalsCheck,
            meta: {
                title: "Ordinals"
            },
        },

        {
            path: '/:pathMatch(.*)*',
            name: "404",
            component: ordinals404,
            meta: {
                title: "Ordinals"
            },
        },
    ],
    scrollBehavior(to) {
        if (to.hash) {
            return {
                el: to.hash,
                behavior: 'smooth',
            }
        }
    }
})
